import React from 'react';

const LayerLibrary: React.FC = () => {
    const layers = [
        { name: 'Input Layer', type: 'InputLayer' },
        { name: 'Conv2D Layer', type: 'Conv2DLayer' },
        { name: 'Concat Layer', type: 'ConcatLayer' },
        { name: 'Output Layer', type: 'OutputLayer' },
    ];

    const handleDragStart = (event: React.DragEvent<HTMLDivElement>, layerType: string) => {
        event.dataTransfer.setData('layerType', layerType);
    };

    return (
        <div className="layer-library">
            <h3>Layer Library</h3>
            <div className="layers">
                {layers.map(layer => (
                    <div
                        key={layer.type}
                        className="layer-item"
                        draggable
                        onDragStart={(event) => handleDragStart(event, layer.type)}
                    >
                        {layer.name}
                    </div>
                ))}
            </div>
        </div>
    );
};

export default LayerLibrary;
